import React from 'react';
import s from './Profile.module.css';
import MyPosts from './MyPosts/MyPosts';



const Profile = () => {
    return <div>

        <ProfileInfo />

        <div>
            < img src="https://images.pexels.com/photos/248797/pexels-photo-248797.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" />
        </div>
        <div>
            < img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQYjDy4WLc7eA7wN5rJILV04fX--F7M2SqWeU7mQKPTjvezOguR" />
        </div>

        <MyPosts />

    </div>

    
}

export default Profile;

